import React, { Component } from 'react';
import Vimeo from '@u-wave/react-vimeo';

import './video.css';


class Videos extends Component {
    constructor() {
        super();
        this.state = {
            videos: [
                {
                    id: 1,
                    src: "https://vimeo.com/549126016"
                },
                {
                    id: 2,
                    src: "https://vimeo.com/440828751"
