                },
                {
                    id: 15,
                    src: "https://vimeo.com/14464004"
                },
                {
                    id: 16,
                    src: "https://vimeo.com/19432324"
                },
                {
                    id: 17,
                    src: "https://vimeo.com/23852975"
                },
                {
                    id: 18,
                    src: "https://vimeo.com/45088660"
                },



            ]
        };
    }


    render() {
        return (
            <div>
                {this.state.videos.map((data, i) => {
                    return (
                        <div key={i}>
                            <Vimeo
                                className = "video"
                                video={data.src}
                                autoplay
                            />
                            <p key={i}>{data.id} </p>
                            <p key={i}>{data.src} </p>

                        </div>
                    )
                })}
            </div>
        );
    }
}

export default Videos
